import React,{ useEffect, useState } from 'react';
import axios from 'axios';

function App() {
  const [todolist, settodo] = useState({items: []})

  useEffect( () => {
    console.log('On Going Connection')
    axios.get('todos')
      .then(res => {
        console.log('-------------------------------------->')
        console.log(res)
        settodo(res.data);
      })
      .catch(err => {
        console.log('============================================>')
        console.log(err)
      })

  },[todolist])
  return (
    <div className="App">
        {
          todolist.items.map(data => <p>data.title</p>)
        }
    </div>
  );
}

export default App;
